import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';

const Header: React.FC = () => (
  <header style={{
    backgroundColor: '#252525',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '16px 16px',
    position: 'fixed',
    zIndex: 1000,

  }}>
    <Link to="/">
      <img
        src={logo}
        alt="Логотип"
        style={{ height: 75 }}
      />
    </Link>
  </header>
);

export default Header;
